BEGIN TRANSACTION;
PRAGMA writable_schema=ON;
CREATE TABLE 'musclesearch_content'(docid INTEGER PRIMARY KEY, 'c0id', 'c1lat_name', 'c2name', 'c3origo', 'c4insertio', 'c5functio');
CREATE TABLE 'musclesearch_segments'(blockid INTEGER PRIMARY KEY, block BLOB);
CREATE TABLE 'musclesearch_segdir'(level INTEGER,idx INTEGER,start_block INTEGER,leaves_end_block INTEGER,end_block INTEGER,root BLOB,PRIMARY KEY(level, idx));
CREATE TABLE 'musclesearch_docsize'(docid INTEGER PRIMARY KEY, size BLOB);
CREATE TABLE 'musclesearch_stat'(id INTEGER PRIMARY KEY, value BLOB);
CREATE TABLE tbl_arteries (id integer NOT NULL PRIMARY KEY AUTOINCREMENT, lat_name text NOT NULL, name text NOT NULL, parent_id INTEGER REFERENCES tbl_arteries (id), UNIQUE (id));
pars abdominalis aortae','Abdominal aorta',16);
pars descendens aortae','Descending aorta',3);
CREATE TABLE tbl_musclegroups (id integer NOT NULL PRIMARY KEY AUTOINCREMENT, name text NOT NULL, lat_name text NOT NULL, parent_id INTEGER, explanation TEXT, FOREIGN KEY (parent_id) REFERENCES tbl_musclegroups (id));
CREATE TABLE tbl_muscles (id integer NOT NULL PRIMARY KEY AUTOINCREMENT, lat_name text NOT NULL, name text NOT NULL, origo text NOT NULL, insertio text NOT NULL, functio text NOT NULL, nerve text NOT NULL, artery integer NOT NULL, vein integer NOT NULL, image text NOT NULL, comment text NOT NULL, image_color text NOT NULL, musclegroup_id INTEGER REFERENCES tbl_musclegroups (id), UNIQUE (id));
CREATE TABLE 'tbl_muscles_arteries' ('muscle_id' INTEGER NOT NULL, 'arterie_id' INTEGER NOT NULL, PRIMARY KEY ('muscle_id', 'arterie_id'));
CREATE TABLE 'tbl_muscles_nerves' ('muscle_id' INTEGER NOT NULL, 'nerve_id' INTEGER NOT NULL, PRIMARY KEY ('muscle_id', 'nerve_id'));
CREATE TABLE 'tbl_muscles_veins' ('muscle_id' INTEGER NOT NULL, 'vein_id' INTEGER NOT NULL, PRIMARY KEY ('muscle_id', 'vein_id'));
CREATE TABLE 'tbl_nerves' (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `lat_name` text NOT NULL
,  `name` text NOT NULL
,'parent_id' varchar(255) NOT NULL
);
CREATE TABLE 'tbl_veins' (
  `id` integer NOT NULL PRIMARY KEY AUTOINCREMENT
,  `lat_name` text NOT NULL
,  `name` text NOT NULL
,'parent_id' text NOT NULL
,  UNIQUE (`id`)
);
DELETE FROM sqlite_sequence;
CREATE VIEW view_arteries AS SELECT * FROM 
(
WITH RECURSIVE tbl (
    id,
    name,
    parent_id,
    grouplevel,
    bottomgroupid
)
AS (
    SELECT bottomgroup.id,
           bottomgroup.name,
           bottomgroup.parent_id,
           0,
           bottomgroup.id
      FROM tbl_arteries bottomgroup
    UNION
    SELECT art.id,
           art.name,
           art.parent_id,
           tbl.grouplevel - 1,
           tbl.bottomgroupid
      FROM tbl_arteries art
           INNER JOIN
           tbl ON art.id = tbl.parent_id
)
SELECT *
  FROM tbl
 ORDER BY grouplevel) as grouptree;
CREATE VIEW view_grouptree AS SELECT * FROM 
(
WITH RECURSIVE tbl (
    id,
    name,
    parent_id,
    grouplevel,
    bottomgroupid
)
AS (
    SELECT bottomgroup.id,
           bottomgroup.name,
           bottomgroup.parent_id,
           0,
           bottomgroup.id
      FROM tbl_musclegroups bottomgroup
    UNION
    SELECT mc.id,
           mc.name,
           mc.parent_id,
           tbl.grouplevel - 1,
           tbl.bottomgroupid
      FROM tbl_musclegroups mc
           INNER JOIN
           tbl ON mc.id = tbl.parent_id
)
SELECT *
  FROM tbl
 ORDER BY grouplevel) as grouptree;
PRAGMA writable_schema=OFF;
COMMIT;
